ARSA2 = Anterior.rsa(2);
ARSA3 = Anterior.rsa(3);

ARIA = sym('ARIA', [3 1]);
ARIA1 = Anterior.ria(1);
ARIA2 = Anterior.ria(2);
ARIA3 = Anterior.ria(3);

